// import classnames from 'classnames';
import React from "react";
import { useNavigate } from "react-router-dom";

const ToLastPage = ({style}) => {
    const navigate = useNavigate();
    const goBack = () => {
        navigate(-1);
    };

    return (
        <div>
            <button
            onClick={goBack}
            className={style}>
                Back
            </button>
        </div>
    )
}

export default ToLastPage;
